import React from 'react'
import {render} from 'react-dom'

const mystyle = {
	textAlign: 'center',
	fontSize: '20px'
}

function Hello ()
{
	return (
		<div>
			<p style={mystyle}> Hello world </p>
		</div>
	)
}
function Getname ()
{
	return (
		<div>
			<p style={mystyle}> Hello {prompt("Print name")} </p>
		</div>
	)
}

render(<Hello />, document.getElementById("root"));
render(<Getname />, document.querySelector("#root"));
